import "./main.css";
import Movies from "../components/Movies";
import Navigation from "../components/navigation";
const MainMovies2 = (props) => {
  return (
    <>
      <Navigation />
      <h1 className="mtitle">Movies</h1>
      <Movies j={1} k={30} />
      <Movies j={31} k={60} />
      <Movies j={61} k={100} />
      <Movies j={110} k={140} />
      <Movies j={141} k={170} />
      <Movies j={171} k={200} />
      <Movies j={201} k={230} />
    </>
  );
};

export default MainMovies2;
